import React,{Component} from 'react';

class Myheader extends Component {

    constructor(props) {
        super(props);
    }
    
    render() {

        return (
            <div>
                <ul>
                    <li><div>现有确诊</div></li>
                    <li><div>累计确诊</div></li>
                    <li><div>累计治愈</div></li>
                    <li><div>累计死亡</div></li>
                </ul>
            </div>
        )
    }
}

export default Myheader;
